import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react'

const coords = {
    center : {
        lat: 59.95,
        lng: 30.33
    },
    zoom: 11
}

function Map() {
    return (
        <div>
        <GoogleMapReact
            defaultCenter={coords.center}
            defaultZoom={coords.zoom}
        >
            SALUT

        </GoogleMapReact>
        </div>
    )
}

export default Map;
